import React from "react";

interface AnyButtonProps {
    setA: (val:number) => void
}

/**
 Компонент карточки
 */
const AnyButton = (props:AnyButtonProps) => {

    return (
        <div style={{display: "flex",justifyContent:"space-evenly"}}>
            <button onClick={() => props.setA(10)}>Изменяем A на 10 без Rx JS</button>
            <button onClick={() => setA(10)}>Изменяем A на 10 с Rx JS</button>
        </div>
    );
};

export default AnyButton;
